transform = transforms.Compose([
    transforms.CenterCrop(128),
    transforms.Resize((224, 224)),
    transforms.RandomHorizontalFlip(), # 이미지를 무작위로 수평 뒤집기
    transforms.RandomRotation(30), # 이미지를 30도 무작위로 회전
    # 이미지의 밝기, 대비, 채도, 색조를 무작위로 변경
    transforms.ColorJitter(brightness=0.2, contrast=0.2, saturation=0.2, hue=0.1),
    transforms.RandomGrayscale(p=0.2), # 20% 확률로 이미지를 그레이스케일로 변환
    transforms.ToTensor(),
    transforms.Normalize((0.5, 0.5, 0.5), (0.5, 0.5, 0.5))
])

# 영상, 라벨 데이터셋
train_dataset = ImageFolder(f'{data_root}/train/', transform=transform)
val_dataset = ImageFolder(f'{data_root}/val/', transform=transform)

train_loader = DataLoader(train_dataset, batch_size=4, shuffle=True)
val_loader = DataLoader(val_dataset, batch_size=4, shuffle=False)

"""![image.png](data:image/png;base64,)"""

# AlexNet 구현하기
class AlexNet(nn.Module): # 모델의 기반 상속
  def __init__(self, num_classes=1000): # 1000개로 내보내기
    super(AlexNet, self).__init__() # 부모 생성자 호출
    self.conv1 = nn.Conv2d(3, 96, kernel_size=11, stride=4, padding=2) # (3개 받아서 48+48, 파란 숫자가 kernel_size)
    self.conv2 = nn.Conv2d(96, 256, kernel_size=5, padding=2)
    self.conv3 = nn.Conv2d(256, 384, kernel_size=3, padding=1)
    self.conv4 = nn.Conv2d(384, 384, kernel_size=3, padding=1)
    self.conv4 = nn.Conv2d(384, 256, kernel_size=3, padding=1)
    self.maxpool = nn.MaxPool2d(kernel_size=3, stride=2) # MaxPooling
    self.fc1 = nn.Linear(256 * 6 * 6, 4096) # 6, 7, 8 레이어
    self.fc2 = nn.Linear(4096, 4096)
    self.fc3 = nn.Linear(4096, num_classes) # num_classes(1000)개만큼 내보내기
    self.dropout = nn.Dropout()

  def forward(self, x):
    x = self.maxpool(F.relu(self.conv1(x))) # 이미지 받아서 conv1레이어 통과하고 relu(activation function: 곡선화)되고 맥스풀링돼서 x에 저장
    x = self.maxpool(F.relu(self.conv2(x)))
    x = F.relu(self.conv3(x)) # 여기엔 맥스풀링 없음
    x = F.relu(self.conv4(x))
    x = self.maxpool(F.relu(self.conv5(x)))
    # FC Layer
    x = x.view(x.size(0), 256*6*6) # 배치 차원 유지하면서 flatten (batch_size, 영상크기)
    x = self.dropout(F.relu(self.fc1(x))) # Dense
    x = self.dropout(F.relu(self.fc2(x)))
    x = self.fc3(x)
    return x

class AlexNet(nn.Module):
    def __init__(self, num_classes=1000):
        super(AlexNet, self).__init__()
        self.conv1 = nn.Conv2d(3, 96, kernel_size=11, stride=4, padding=2)
        self.conv2 = nn.Conv2d(96, 256, kernel_size=5, padding=2)
        self.conv3 = nn.Conv2d(256, 384, kernel_size=3, padding=1)
        self.conv4 = nn.Conv2d(384, 384, kernel_size=3, padding=1)
        self.conv5 = nn.Conv2d(384, 256, kernel_size=3, padding=1)
        self.maxpool = nn.MaxPool2d(kernel_size=3, stride=2)
        self.fc1 = nn.Linear(256 * 6 * 6, 4096)
        self.fc2 = nn.Linear(4096, 4096)
        self.fc3 = nn.Linear(4096, num_classes)
        self.dropout = nn.Dropout()
    def forward(self, x):
        x = self.maxpool(F.relu(self.conv1(x)))
        x = self.maxpool(F.relu(self.conv2(x)))
        x = F.relu(self.conv3(x))
        x = F.relu(self.conv4(x))
        x = self.maxpool(F.relu(self.conv5(x)))
        # FC Layer
        x = x.view(x.size(0), 256 * 6 * 6)
        x = self.dropout(F.relu(self.fc1(x)))
        x = self.dropout(F.relu(self.fc2(x)))
        x = self.fc3(x)
        return x

model = AlexNet(num_classes=2)
model = model.to(device)

# 손실함수, 최적화
loss_func = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=0.0001)
# Adam은 learning rate와 epoch에 영향을 받기 때문에 lr을 너무 크게 주거나 epoch을 너무 작게 주면 안됨

def calculate_accuracy(loader, model):
  model.eval() # 학습모드 -> 검증모드
  correct = 0
  total = 0
  with torch.no_grad(): # 학습X
    for data in loader:
      images, labels = data
      images, labels = images.to(device), labels.to(device) # gpu쓰기 때문에 이미지와 라벨 옮겨주기
      outputs = model(images)
      _, predicted = torch.max(outputs.data, 1)
      total += labels.size(0)
      correct += (predicted == labels).sum().item() # 맞으면 0 틀리면 1
  return 100 * correct / total

train_losses = []
val_losses = []
val_accuracies = []

num_epochs = 30
for epoch in range(num_epochs):
    model.train()
    running_loss = 0.0
    for i, data in enumerate(train_loader):
        inputs, labels = data
        inputs, labels = inputs.to(device), labels.to(device)
        optimizer.zero_grad()
        outputs = model(inputs)
        loss = loss_func(outputs, labels)
        loss.backward()
        optimizer.step()
        running_loss += loss.item()
    train_loss = running_loss / len(train_loader)
    train_losses.append(train_loss)

    val_loss = 0.0
    model.eval()
    with torch.no_grad():
        for inputs, labels in val_loader:
            inputs, labels = inputs.to(device), labels.to(device)
            outputs = model(inputs)
            loss = loss_func(outputs, labels)
            val_loss += loss.item()
    val_loss /= len(val_loader)
    val_losses.append(val_loss)

    val_accuracy = calculate_accuracy(val_loader, model)
    val_accuracies.append(val_accuracy)

    print(f'Epoch {epoch + 1}, Train Loss: {train_loss: .6f}, Val Loss: {val_loss: .6f}, Val Accuracy: {val_accuracy: .2f}%')

plt.figure(figsize=(15, 5))
# 학습 손실 그래프
plt.subplot(1, 3, 1)
plt.plot(train_losses, label='Train Loss')
plt.xlabel('Epoch')
plt.ylabel('Loss')
plt.title('Training Loss Over Epochs')
plt.legend()
# 검증 정확도 그래프
plt.subplot(1, 3, 2)
plt.plot(val_losses, label='Validation Loss')
plt.xlabel('Epoch')
plt.ylabel('Loss')
plt.title('Validation Loss Over Epochs')
plt.legend()
# 검증 정확도 그래프
plt.subplot(1, 3, 3)
plt.plot(val_accuracies, label='Validation Accuracy', color='orange')
plt.xlabel('Epoch')
plt.ylabel('Accuracy (%)')
plt.title('Validation Accuracy Over Epochs')
plt.legend()
plt.tight_layout()
plt.show()

#  test 데이터에서 glass 5명, no glass 5명 예측이 정확한지 시각화
def load_and_transform_image(image_path, transform4):
  image = Image.open(image_path).convert('RGB')
  width, height = image.size

  # 중앙에서 128*128 크기로 크롭하기 위한 시작점과 끝점 계산
  left = (width - 128)/2
  top = (height - 128)/2
  right = (width + 128)/2
  bottom = (height + 128)/2

  # 중앙 영역 크롭
  image_cropped = image.crop((left, top, right, bottom))
  return transform(image_cropped), image_cropped

class_folders = {
    'glass': f'{data_root}/test/glasses',
    'no glass': f'{data_root}/test/noglasses'
}

plt.figure(figsize=(20, 8))
counter = 1
